import React from "react";

export class Login extends React.Component<any, any> {
    constructor(props: any) {
        super(props);
        this.state = {
            username: "",
            password: ""
        }
        // handlesubmit == submits the data -- this posts data to backend
        // handlechange == changes the state
    }
    render() {
        return (
            <div>Login</div>
        )
    }
}
